import data from './data'

const Projects = () => {
    // const {id, img} = data;

    return (
        <section id='projects'>
            <div className="container">
                <h2>Projects</h2>
                {projects.map((item) => {
                    const {id, image, title} = item;
                    return <div>
                        <img src={image} key={id} />
                        <h1>{title}</h1>
                    </div>
                })} 
            </div>
        </section>
    )
}

export default Projects
